/**
 * @param {number} target
 * @param {number[]} position 
 * @param {number[]} speed
 * @return {[number, number]} Returns [result, executionTime]
 */
var carFleetWithTimer = function(target, position, speed) {
    const start = performance.now();
    
    const sortedPosition = [...position];
    sortedPosition.sort((a, b) => b - a);
    const times = sortedPosition.map((pos, index) => (target - pos) / speed[position.indexOf(pos)]);

    let lastFleetArival = times[0];
    let totalFleet = 1;
    
    for (let time of times) {
        if(lastFleetArival < time) {
            lastFleetArival = time;
            totalFleet++;
        }
    }
    
    const end = performance.now();
    const executionTime = end - start;
    
    return [totalFleet, executionTime];
};

var carFleetWithTimer2 = function(target, position, speed) {
    const cars = position.map((pos, index) => ({
        pos,
        time: (target - pos) / speed[index]
    }))
    
    cars.sort((a, b) => b.pos-a.pos)
    const stack = []
    stack.push(cars[0].time)
    
    for(let {pos, time} of cars){
        if( stack[stack.length - 1] < time){
            stack.push(time)
        }
        
    }
     
    return stack.length
    
}



